import { Link, useParams } from "react-router-dom";
import { scienceLessons, scienceQuizzes } from "../data.js";
import { Button, Form, FormGroup, Input, Label } from "reactstrap";

export const Quiz = () => {
  const { lessonId } = useParams();
  console.log(lessonId);
  const quiz = scienceQuizzes.find(
    (quiz) => quiz.lessonId === parseInt(lessonId)
  );
  return (
    <div className="lesson-text">
      <h2>
        Quiz for {quiz.subject}: Lesson {lessonId}
      </h2>
      <Form>
        {Object.entries(quiz.questions).map(([key, value]) => (
          <>
            <legend key={key}>{value.question}</legend>
            <FormGroup check>
              <Input name="radio1" type="radio" /> <Label check></Label>
            </FormGroup>
          </>
        ))}
        <hr></hr>
        <legend></legend>
        <Input name="radio1" type="radio" />{" "}
        <Label check>
          Option one is this and that—be sure to include why it‘s great
        </Label>
        <FormGroup check>
          <Input name="radio1" type="radio" />{" "}
          <Label check>
            Option two can be something else and selecting it will deselect
            option one
          </Label>
        </FormGroup>
        <FormGroup check disabled>
          <Input disabled name="radio1" type="radio" />{" "}
          <Label check>Option three is disabled</Label>
        </FormGroup>
      </Form>
      <FormGroup check>
        <Input type="checkbox" /> <Label check>Check me out</Label>
      </FormGroup>
      <Button>Submit</Button>
    </div>
  );
};
